# Arengutreening

## Sissejuhatus

Arengutreening on individuaalsete või grupiliste arengukäitumiste muutmise protsess, mille eesmärk on tõsta isiklik või organisatsiooni arengutaset. See on osa arengukäitumise, arengumanagedmenti ja üldisemalt arengukäsitsemisest, mis on oluline saavutada organisatsioonide ja üksikkülaste edukus.

## Olemus

Arengutreening on mitmevaateneline protsess, mis hõlmab mitmeid muutuste vahendeid, näiteks:

*   **Edukate arengulahenduste implementeerimine**: arengulahenduste võimalikusest, mille eesmärk on parandada arengukäitumist;
*   **Arengukäitumise hindamine**: hindamine, mille eesmärk on teada, kus asuvad arengukäitumise vead ja kuidas need kaotada;
*   **Arengukäitumise õppimine**: õppimine, mille eesmärk on saada teadmisi arengukäitumise kohta;
*   **Arengukäitumise rakendamine**: rakendamine, mille eesmärk on rakendada arengukäitumise nõuandeid.

## Sihid

Arengutreeningi sihiks on:

*   **Arengukäitumise parandamine**: arengukäitumise parandamine, et parandada arengukäitumise tase;
*   **Arengukäitumise tõus**: arengukäitumise tõus, et parandada arengukäitumise tase;
*   **Arengukäitumise parandamine**: arengukäitumise parandamine, et parandada arengukäitumise tase.

## Tulemused

Arengutreeningi tulemused võivad olla:

*   **Arengukäitumise parandamine**: arengukäitumise parandamine, et parandada arengukäitumise tase;
*   **Arengukäitumise tõus**: arengukäitumise tõus, et parandada arengukäitumise tase;
*   **Arengukäitumise parandamine**: arengukäitumise parandamine, et parandada arengukäitumise tase.

## Juhendaja

Arengutreeningi juhendajaks võib olla:

*   **Arengukäitumise nõustaja**: arengukäitumise nõustaja, kes annab nõuandeid arengukäitumise kohta;
*   **Arengukäitumise spetsialist**: arengukäitumise spetsialist, kes on eriti koolitatud arengukäitumise kohta;
*   **Arengukäitumise konsultant**: arengukäitumise konsultant, kes annab nõuandeid arengukäitumise kohta.

